/**
 * Parses the contents with JSON parser of {@link CategoryEntity} and {@link ItemEntity}. Probably
 * will add more support later
 *
 * @param contents
 * @return a parsed entity
 * @throws Exception
 */
public static AbstractEntity parse(String contents) throws Exception {
  Log.d(FdConfig.DEBUG_TAG, "Trying to parse scanned contents: " + contents);

  JSONObject jsonObject = new JSONObject(contents);
  JSONArray names = jsonObject.names();

  for (int i = 0; i < names.length(); i++) {
    String name = names.getString(i);

    if (name.equals("table")) {
      TableEntity table = new TableEntity();
      table.parse(jsonObject.getJSONObject(name));

      return table;
    } else if (name.equals("item")) {
      ItemEntity item = new ItemEntity();
      item.parse(jsonObject.getJSONObject(name));

      return item;
    }
  }

  return null;
}

protected void sendIntent(String content) {
  try {
    JSONObject object = new JSONObject(content);
    int c = object.getInt("c");
    if (c == 1) {
      JSONObject json = object.getJSONObject("obj");
      String emojId = json.getString("i");
      Intent intent = new Intent(getApplicationContext(), PushEmojActivity.class);
      intent.putExtra(AppConstant.INTENT_PUSH_EMOJID, emojId);
      intent.putExtra(AppConstant.INTENT_PUSH_FROM_NOTIFY, true);
      intent.setFlags(Intent.FLAG_ACTIVITY_CLEAR_TOP | Intent.FLAG_ACTIVITY_NEW_TASK);
      startActivity(intent);
      Log.d(TAG, "sendIntent...");
    }
  } catch (Exception e) {
    // TODO: handle exception
    Log.e(TAG, e.toString());
  }
}

@Test
public void testJobConfDefault() throws JSONException, Exception {
  WebResource r = resource();
  Map<JobId, Job> jobsMap = appContext.getAllJobs();
  for (JobId id : jobsMap.keySet()) {
    String jobId = MRApps.toString(id);

    ClientResponse response =
        r.path("ws")
            .path("v1")
            .path("history")
            .path("mapreduce")
            .path("jobs")
            .path(jobId)
            .path("conf")
            .get(ClientResponse.class);
    assertEquals(MediaType.APPLICATION_JSON_TYPE, response.getType());
    JSONObject json = response.getEntity(JSONObject.class);
    assertEquals("incorrect number of elements", 1, json.length());
    JSONObject info = json.getJSONObject("conf");
    verifyHsJobConf(info, jobsMap.get(id));
  }
}

public void getTaxonomies(JSONArray taxonomiesJSON) {
  for (int i = 0; i < taxonomiesJSON.length(); i++) {
    JSONObject taxonomyJSON = null;
    try {
      taxonomyJSON = taxonomiesJSON.getJSONObject(i);
    } catch (JSONException e) {
      taxonomyJSON = null;
      e.printStackTrace();
    }

    if (taxonomyJSON != null) {
      // take off the wrapper
      JSONObject taxonomyJSONData = null;
      try {
        taxonomyJSONData = taxonomyJSON.getJSONObject("container_taxonomy");
      } catch (JSONException e) {
        taxonomyJSONData = null;
      }

      if (taxonomyJSONData != null) taxonomies.add(new ContainerTaxonomy(taxonomyJSONData));

      Log.d(
          "ContainerTaxonomies",
          "Added container taxonomy " + taxonomies.get(taxonomies.size() - 1).name);
    }
  }
}

/** Returns the Set of component types used in the given form file source. */
public static Set<String> getComponentTypesFromFormFile(String source) {
  Set<String> componentTypes = new HashSet<String>();
  JSONObject propertiesObject = parseSourceFile(source);
  try {
    collectComponentTypes(propertiesObject.getJSONObject("Properties"), componentTypes);
  } catch (JSONException e) {
    throw new IllegalArgumentException("Unable to parse file - invalid $JSON section syntax");
  }
  return componentTypes;
}

@Override
public View getView(int position, View convertView, ViewGroup parent) {
  View v = convertView;
  if (v == null) {
    LayoutInflater vi = (LayoutInflater) getSystemService(Context.LAYOUT_INFLATER_SERVICE);
    v = vi.inflate(R.layout.forum_topic_row, null);
  }
  final JSONObject topic = getItem(position);
  try {
    String lastReply = topic.getString("lastreply");
    if (lastReply.equals("false")) {
      lastReply = topic.getString("created");
    } else {
      lastReply = topic.getJSONObject("lastreply").getString("created");
    }

    ((TextView) (v.findViewById(R.id.label))).setText(topic.getString("label"));
    ((TextView) (v.findViewById(R.id.lastReply))).setText(lastReply);
    ((TextView) (v.findViewById(R.id.count))).setText("(" + topic.getString("replies") + ")");

  } catch (JSONException e) {
    e.printStackTrace();
  }

  // click to open topic page
  v.setOnClickListener(
      new OnClickListener() {
        @Override
        public void onClick(View v) {
          Intent i = new Intent(Forum.this, ForumReplies.class);
          try {
            i.putExtra("tid", topic.getInt("id"));
          } catch (JSONException e) {
            e.printStackTrace();
          }
          i.putExtra("cm", courseManagerCon);
          startActivity(i);
        }
      });

  return v;
}

public static Column load(String s) throws Exception {
  JSONObject obj = ParsingUtilities.evaluateJsonStringToObject(s);
  Column column = new Column(obj.getInt("cellIndex"), obj.getString("originalName"));

  column._name = obj.getString("name");
  if (obj.has("reconConfig")) {
    column._reconConfig = ReconConfig.reconstruct(obj.getJSONObject("reconConfig"));
  }
  if (obj.has("reconStats")) {
    column._reconStats = ReconStats.load(obj.getJSONObject("reconStats"));
  }

  return column;
}

