private String loadBlocksAndGenerateYail(
    String formPropertiesSource, String codeblocksSource, String yailPath)
    throws YailGenerationException {
  // Currently when YailGenerator is executed as a separate process, this method is called only
  // once. However, in tests (see YailGeneratorTest.java), it may called multiple times in
  // parallel. We use synchronized here to handle (prevent) concurreny.
  synchronized (generateYailLock) {
    try {

      // The first time this method is called, langDefRoot will be null.
      if (langDefRoot == null) {
        try {
          langDefRoot = WorkspaceUtils.loadLangDef();
        } catch (Exception e) {
          throw new RuntimeException(e);
        }
        WorkspaceUtils.resetLanguage();
        WorkspaceUtils.loadLanguage(langDefRoot);
        // The following is required to load the "My Definitions" page/drawer.
        loadBlocks(null);
      }

      JSONObject formProperties = WorkspaceUtils.parseFormProperties(formPropertiesSource);
      if (formProperties == null) {
        throw new YailGenerationException("Unable to generate code.");
      }

      String formName;
      try {
        formName = formProperties.getJSONObject("Properties").getString("$Name");
      } catch (JSONException e) {
        throw new YailGenerationException("Unable to generate code.");
      }

      workspace.reset();

      if (!codeblocksSource.isEmpty()) {
        BlockSaveFile blockSaveFile = new BlockSaveFile(langDefRoot, codeblocksSource);
        loadBlocks(blockSaveFile.getRoot());
        if (!cbm.loadComponents(blockSaveFile)) {
          throw new YailGenerationException("Unable to generate code for " + formName + ".");
        }
      }

      if (!cbm.syncFromJson(formProperties)) {
        throw new YailGenerationException("Unable to generate code for " + formName + ".");
      }

      projectLoaded = true;

      if (containsBadBlocks()) {
        throw new YailGenerationException("There are bad blocks in " + formName + ".");
      }

      ComplaintDepartment.clearComplaints();

      HashMap<String, ArrayList<RenderableBlock>> componentMap =
          new HashMap<String, ArrayList<RenderableBlock>>();
      Map<Block, String> warnings = new HashMap<Block, String>();
      List<String> errors = new ArrayList<String>();
      WorkspaceUtils.populateComponentMap(
          componentMap,
          warnings,
          errors,
          false, // not for REPL
          false, // don't compile unattached blocks
          cbm);

      String code =
          YABlockCompiler.generateYailForProject(
              formProperties, componentMap, false); // not for REPL
      String[] compileErrors = ComplaintDepartment.getCompileErrors();
      if (compileErrors.length > 0) {
        String errorMessages = Joiner.on("\n").join(compileErrors);
        throw new YailGenerationException(
            "There are errors that must be fixed in " + formName + ".\n" + errorMessages);
      }

      StringBuilder yail = new StringBuilder();
      yail.append(YABlockCompiler.getYailPrelude(yailPath, formName));
      yail.append(code).append("\n");
      return yail.toString();

    } finally {
      projectLoaded = false;
      workspace.reset();
      cbm.reset();
      pbm.reset();
    }
  }
}

/**
 * Parses the supplied JSON string and adds the extracted ratings to the supplied {@link AppStats}
 * object
 *
 * @param json
 * @param stats
 * @throws JSONException
 */
static void parseRatings(String json, AppStats stats) throws JSONException {
  JSONObject data =
      new JSONObject(json).getJSONObject("result").getJSONArray("1").getJSONObject(0);

  // Ratings values is in 8
  JSONObject values = data.getJSONObject("8");
  // Ratings are at index 1 - 5
  stats.setRating(
      values.getInt("1"),
      values.getInt("2"),
      values.getInt("3"),
      values.getInt("4"),
      values.getInt("5"));

  // Comment count is in 7
  stats.setNumberOfComments(data.getInt("7"));
}

/**
 * Parse server (JSON) response and returns FacebookErrorResponse object.
 *
 * @param response would be String converted from server response (JSON file)
 * @return FacebookErrorResponse object
 * @see com.socmaps.entity.FacebookErrorResponse
 */
public static FacebookErrorResponse parseFacebookError(String response) {
  FacebookErrorResponse fbResponseEntity = new FacebookErrorResponse();

  try {

    JSONObject jObj = new JSONObject(response);
    if (!jObj.isNull("error")) {
      JSONObject errObj = jObj.getJSONObject("error");
      if (!errObj.isNull("message")) {
        fbResponseEntity.setMessage(errObj.getString("message"));
      }
      if (!errObj.isNull("type")) {
        fbResponseEntity.setType(errObj.getString("type"));
      }
      if (!errObj.isNull("code")) {
        fbResponseEntity.setCode(errObj.getInt("code"));
      }
      if (!errObj.isNull("error_subcode")) {
        fbResponseEntity.setErrorSubCode(errObj.getInt("error_subcode"));
      }
    }
  } catch (JSONException e) {
    // TODO: handle exception
  }

  return fbResponseEntity;
}

