/**
 * Using file and label and the Stapler request, create a subclass of series that can process the
 * type selected.
 *
 * @param formData JSON data for series
 */
public static Series createSeries(JSONObject formData, StaplerRequest req) {
  String file = formData.getString("file");
  formData = formData.getJSONObject("fileType");
  formData.put("file", file);
  String type = formData.getString("value");
  Class<? extends Series> typeClass = null;

  if ("properties".equals(type)) {
    typeClass = PropertiesSeries.class;
  } else if ("csv".equals(type)) {
    typeClass = CSVSeries.class;
  } else if ("xml".equals(type)) {
    typeClass = XMLSeries.class;
  }

  return typeClass != null ? req.bindJSON(typeClass, formData) : null;
}

/**
 * returns the daily menu of a specific mensa
 *
 * @param mensaId
 * @return Menuplan of one day
 */
public Menuplan getMenuList(int mensaId) {
  Menuplan plan = new Menuplan();
  rq.setUrl(String.format(ApiUrl.API_DAILY_MENU, mensaId));
  rq.execute();

  try {
    JSONObject js = rq.getJSONData();
    JSONObject content = js.getJSONObject("content");
    String date = content.getString("date");
    plan.parseDate(date);
    JSONArray list = content.getJSONArray("menus");

    for (int i = 0; i < list.length(); i++) {
      DailyMenuBuilder mb = new DailyMenuBuilder();
      mb.parseJson(list.getJSONObject(i));
      DailyMenu menu = mb.create();
      plan.add(menu);
      plan.setDate(menu.getDate());
    }
  } catch (Exception e) {
    Log.e(TAG, e.getMessage());
  }
  return plan;
}

private @Nullable Database toDatabase(@Nonnull ProviderContext ctx, @Nullable JSONObject json)
    throws CloudException, InternalException {
  if (json == null) {
    return null;
  }

  String regionId = ctx.getRegionId();

  try {
    String dbId = (json.has("id") ? json.getString("id") : null);

    if (dbId == null) {
      return null;
    }

    String name = (json.has("name") ? json.getString("name") : null);

    if (name == null) {
      name = "RDBMS MySQL #" + dbId;
    }

    DatabaseState currentState = DatabaseState.PENDING;
    String status = (json.has("status") ? json.getString("status") : null);

    if (status != null) {
      if (status.equalsIgnoreCase("BUILD") || status.equalsIgnoreCase("building")) {
        currentState = DatabaseState.PENDING;
      } else if (status.equalsIgnoreCase("ACTIVE") || status.equalsIgnoreCase("AVAILABLE")) {
        currentState = DatabaseState.AVAILABLE;
      } else if (status.equalsIgnoreCase("RESIZE")) {
        currentState = DatabaseState.MODIFYING;
      } else if (status.equalsIgnoreCase("SHUTDOWN")) {
        currentState = DatabaseState.RESTARTING;
      } else if (status.equalsIgnoreCase("BLOCKED")) {
        currentState = DatabaseState.PENDING;
      } else {
        System.out.println("DEBUG OS Rackspace DB STATE: " + status);
      }
    }
    long created =
        (json.has("created") ? getProvider().parseTimestamp(json.getString("created")) : -1L);

    String hostname = (json.has("hostname") ? json.getString("hostname") : null);
    String flavor = null;

    if (json.has("flavor")) {
      JSONObject f = json.getJSONObject("flavor");

      if (f != null && f.has("id")) {
        flavor = f.getString("id");
      }
    }
    int size = 0;

    if (json.has("volume")) {
      JSONObject v = json.getJSONObject("volume");

      if (v != null && v.has("size")) {
        size = v.getInt("size");
      }
    }
    int port = (json.has("port") ? json.getInt("port") : 3306);

    Database database = new Database();

    database.setAdminUser(null);
    database.setAllocatedStorageInGb(size);
    database.setCreationTimestamp(created);
    database.setCurrentState(currentState);
    database.setEngine(DatabaseEngine.MYSQL);
    database.setHighAvailability(false);
    database.setHostName(hostname);
    database.setHostPort(port);
    database.setName(name);
    database.setProductSize(flavor + ":" + size);
    database.setProviderDatabaseId(dbId);
    database.setProviderDataCenterId(regionId + "-a");
    database.setProviderOwnerId(getTenantId());
    database.setProviderRegionId(regionId);
    return database;
  } catch (JSONException e) {
    throw new CloudException(e);
  }
}

public ArrayList<MessageEntity> getMessages(Integer from, Integer to) {
  postParams = new HashMap<String, ContentBody>();
  ArrayList<MessageEntity> messageArray = new ArrayList<MessageEntity>();

  try {
    postParams.put("user_id", new StringBody((new Integer(userId)).toString()));
    postParams.put("session_hash", new StringBody(session_token));
    postParams.put("from", new StringBody(from.toString()));
    postParams.put("to", new StringBody(to.toString()));
  } catch (UnsupportedEncodingException exp) {
    Log.d("Reactor API: ", exp.getMessage());
  }

  try {
    jsonData = new JSONObject(networkManager.sendRequest(GET_MESSAGES, postParams));
    if (jsonData.get("status").equals("success")) {
      JSONArray messageJSONArray = (JSONArray) jsonData.getJSONArray("messages");

      for (int i = 0; i < messageJSONArray.length(); i++) {
        JSONObject messageJson = messageJSONArray.getJSONObject(i);
        MessageEntity messageEntity =
            new MessageEntity(
                messageJson.getInt("id"),
                messageJson.getInt("from_user"),
                messageJson.getInt("to_user"),
                messageJson.getString("text"),
                messageJson.getString("photo"),
                messageJson.getString("reaction_photo"),
                messageJson.getJSONObject("created_at").getString("date"),
                messageJson.getBoolean("from_me"),
                (!messageJson.getString("is_read").equals("null"))
                    ? messageJson.getBoolean("is_read")
                    : false,
                messageJson.getString("username"),
                messageJson.getString("to_username"),
                messageJson.getBoolean("deleted"));

        int timeZone =
            Integer.parseInt(messageJson.getJSONObject("created_at").getString("timezone_type"));
        messageEntity.setCreatedAt(convertTime(messageEntity.getCreatedAt(), timeZone));

        messageArray.add(i, messageEntity);
      }
    }
  } catch (JSONException exp) {
    Log.d("Reactor API: ", exp.getMessage());
  }
  return messageArray;
}

