/**
 * Posts JSON-RPC 1.1 request.
 *
 * @param randomFive A randomly generated String.
 * @param success <code>true</code> if the expected result should be successful, <code>false
 *     </code> otherwise.
 * @throws Throwable If anything goes wrong.
 */
private void postJSONRPCRequest1_1(String randomFive, boolean success) throws Throwable {
  String destination = AllTests.url() + "allinone/?_convention=_xins-jsonrpc";
  String input =
      "{ \"version\" : \"1.1\", \"method\" : \"ResultCode\", \"params\" : { \"useDefault\" : false, \"inputText\" : \""
          + randomFive
          + "\" } }";
  String jsonResult =
      CallingConventionTests.postData(destination, input, "application/json", 200);
  // System.err.println("1_1: " + jsonResult);
  JSONObject jsonObject = new JSONObject(jsonResult);
  String version = jsonObject.getString("version");
  assertEquals("1.1", version);
  JSONObject error = jsonObject.optJSONObject("error");
  if (success) {
    JSONObject result = jsonObject.getJSONObject("result");
    String outputText = result.getString("outputText");
    assertEquals("Incorrect result received: " + outputText, randomFive + " added.", outputText);
    assertNull(error);
  } else {
    assertNotNull(error);
    String errorName = error.getString("name");
    assertEquals("Incorrect error code received: " + errorName, "AlreadySet", errorName);
    int errorCode = error.getInt("code");
    assertTrue(errorCode >= 100 && errorCode <= 999);
    String errorMessage = error.getString("message");
    assertEquals(
        "Unexpected error message: " + errorMessage,
        "The parameter has already been given.",
        errorMessage);
    JSONObject errorParams = error.getJSONObject("error");
    int count = errorParams.getInt("count");
    assertTrue(count > 0);
  }
}

Idea parseData(String data) throws JSONException {
  // Ideas
  final String ID = "id";
  final String DESCRIPTION = "description";
  final String TAGS = "tags";
  final String SPARKS = "sparks";
  final String USER = "user";
  // Sparks (currently unused)
  final String SPARK_TYPE = "spark_type";
  final String CONTENT_TYPE = "content_type";
  final String CONTENT = "content";
  final String CREATED_AT = "created_at";
  final String COMMENTS = "comments";
  final String COMMENT_TEXT = "comment_text";
  final String NAME = "name";
  final String FILE = "file";

  // getting JSON string from URL
  JSONObject json = new JSONObject(data);

  // Getting Idea parameters
  int id = json.getInt(ID);
  String description = json.getString(DESCRIPTION);
  JSONArray tagsJSON = json.getJSONArray(TAGS);
  String[] tags = new String[tagsJSON.length()];
  for (int i = 0; i < tagsJSON.length(); i++) {
    tags[i] = tagsJSON.getString(i);
  }

  // Getting Array of Sparks
  JSONArray sparksJSON = json.getJSONArray(SPARKS);
  Spark[] sparks = new Spark[sparksJSON.length()];
  for (int i = 0; i < sparksJSON.length(); i++) {
    Log.v("Get idea for detail", "One spark retrieved");
    JSONObject s = sparksJSON.getJSONObject(i);

    int sparkId = s.getInt(ID);
    String sparkDate = s.getString(CREATED_AT);
    char sparkContentType = s.getString(CONTENT_TYPE).charAt(0);
    char sparkType = s.getString(SPARK_TYPE).charAt(0);
    String content = s.getString(CONTENT);

    Spark newSpark = new Spark(sparkId, sparkType, sparkContentType, content, sparkDate);
    if (s.has(FILE)) {
      String fileUrl = s.getString(FILE);
      newSpark.setCloudLink(fileUrl);
    }
    sparks[i] = newSpark;
  }
  // Getting Array of Users
  JSONObject firstUserJSON = json.getJSONObject(USER);
  String firstUser = firstUserJSON.getString(NAME);

  String firstCreatedAt = json.getString(CREATED_AT);

  JSONArray ideaComments = json.getJSONArray(COMMENTS);
  Comment[] comments = new Comment[ideaComments.length()];
  for (int i = 0; i < ideaComments.length(); i++) {
    JSONObject c = ideaComments.getJSONObject(i);
    int curCommentId = c.getInt(ID);
    String curCommentContent = c.getString(COMMENT_TEXT);
    JSONObject curCommentUser = c.getJSONObject(USER);
    String curCommentUsername = curCommentUser.getString(NAME);
    Comment newComment = new Comment(curCommentId, curCommentContent, curCommentUsername);
    comments[i] = newComment;
  }

  return new Idea(id, description, tags, sparks, firstUser, firstCreatedAt, comments);
}

/**
 * Native implementation of pgQuerySoup
 *
 * @param args
 * @param callbackId
 * @return
 * @throws JSONException
 */
private PluginResult querySoup(JSONArray args, String callbackId) throws JSONException {
  // Parse args
  JSONObject arg0 = args.getJSONObject(0);
  String soupName = arg0.getString(SOUP_NAME);
  JSONObject querySpecJson = arg0.getJSONObject(QUERY_SPEC);
  QueryType queryType = QueryType.valueOf(querySpecJson.getString(QUERY_TYPE));
  String path = querySpecJson.isNull(INDEX_PATH) ? null : querySpecJson.getString(INDEX_PATH);
  String matchKey = querySpecJson.isNull(MATCH_KEY) ? null : querySpecJson.getString(MATCH_KEY);
  String beginKey = querySpecJson.isNull(BEGIN_KEY) ? null : querySpecJson.getString(BEGIN_KEY);
  String endKey = querySpecJson.isNull(END_KEY) ? null : querySpecJson.getString(END_KEY);
  String likeKey = querySpecJson.isNull(LIKE_KEY) ? null : querySpecJson.getString(LIKE_KEY);
  Order order = Order.valueOf(querySpecJson.optString(ORDER, "ascending"));
  int pageSize = querySpecJson.getInt(PAGE_SIZE);

  // Building query spec
  QuerySpec querySpec = null;
  switch (queryType) {
    case exact:
      querySpec = QuerySpec.buildExactQuerySpec(path, matchKey, pageSize);
      break;
    case range:
      querySpec = QuerySpec.buildRangeQuerySpec(path, beginKey, endKey, order, pageSize);
      break;
    case like:
      querySpec = QuerySpec.buildLikeQuerySpec(path, likeKey, order, pageSize);
      break;
    default:
      throw new RuntimeException("Fell through switch: " + queryType);
  }

  // Run query
  SmartStore smartStore = ForceApp.APP.getSmartStore();
  int countRows = smartStore.countQuerySoup(soupName, querySpec);
  int totalPages = countRows / querySpec.pageSize + 1;

  // Build store cursor
  StoreCursor storeCursor = new StoreCursor(soupName, querySpec, totalPages, 0);
  storeCursors.put(storeCursor.cursorId, storeCursor);

  // Build json result
  JSONObject result = storeCursor.toJSON(smartStore);

  // Done
  return new PluginResult(PluginResult.Status.OK, result);
}

