              ContentProviderOperation.newUpdate(ContactsContract.Data.CONTENT_URI)
                  .withSelection(
                      ContactsContract.CommonDataKinds.Photo._ID
                          + "=? AND "
                          + ContactsContract.Data.MIMETYPE
                          + "=?",
                      new String[] {
                        photoId, ContactsContract.CommonDataKinds.Photo.CONTENT_ITEM_TYPE
                      })
                  .withValue(ContactsContract.Data.IS_SUPER_PRIMARY, 1)
                  .withValue(ContactsContract.CommonDataKinds.Photo.PHOTO, bytes)
                  .build());
        }
      }
    }
  } catch (JSONException e) {
    Log.d(LOG_TAG, "Could not get photos");
  }

  boolean retVal = true;

  // Modify contact
  try {
    mApp.getContentResolver().applyBatch(ContactsContract.AUTHORITY, ops);
  } catch (RemoteException e) {
    Log.e(LOG_TAG, e.getMessage(), e);
    Log.e(LOG_TAG, Log.getStackTraceString(e), e);
    retVal = false;
  } catch (OperationApplicationException e) {
    Log.e(LOG_TAG, e.getMessage(), e);
    Log.e(LOG_TAG, Log.getStackTraceString(e), e);
    retVal = false;
  }

  // if the save was a succes return the contact ID
  if (retVal) {
    return id;
  } else {
    return null;
  }
}

public JSONArray controlledLists(Storage storage, String vocabname, Record vr, Integer limit)
    throws JSONException {
  JSONArray displayNames = new JSONArray();
  try {
    // Get List
    int resultsize = 1;
    int pagenum = 0;
    int pagesize = 200;
    if (limit != 0 && limit < pagesize) {
      pagesize = limit;
    }
    while (resultsize > 0) {
      JSONObject restriction = new JSONObject();
      restriction.put("pageNum", pagenum);
      restriction.put("pageSize", pagesize);

      String url = vr.getID() + "/" + vocabname;
      JSONObject data = null;
      try {
        data = storage.getPathsJSON(url, restriction);
      } catch (UnderlyingStorageException e) {
        // need to initialise this vocab
        log.error("Could not retreive term list with URL '%s' from Services layer.", url);
        // REM 8/28/2015 - This code is broken? See
        // https://issues.collectionspace.org/browse/CSPACE-6151
        Instance n = vr.getInstance(vr.getID() + "-" + vocabname);
        JSONObject fields =
            new JSONObject(
                "{'displayName':'"
                    + n.getTitle()
                    + "','shortIdentifier':'"
                    + n.getWebURL()
                    + "'}");
        if (vr.getFieldFullList("termStatus") instanceof Field) {
          fields.put(
              "termStatus", ((Field) vr.getFieldFullList("termStatus")).getOptionDefault());
        }
        storage.autocreateJSON(vr.getID(), fields, restriction);
        data = storage.getPathsJSON(url, restriction);
      }
      if (data.has("listItems")) {
        String[] results = (String[]) data.get("listItems");
        /* Get a view of each */
        for (String result : results) {
          // change csid into displayName
          JSONObject namedata = getDisplayNameList(storage, vr.getID(), vocabname, result);
          displayNames.put(namedata);
        }

        Integer total = data.getJSONObject("pagination").getInt("totalItems");
        pagesize = data.getJSONObject("pagination").getInt("pageSize");
        // Integer itemsInPage = data.getJSONObject("pagination").getInt("itemsInPage");
        pagenum = data.getJSONObject("pagination").getInt("pageNum");
        pagenum++;
        // are there more results
        if (total <= (pagesize * (pagenum))) {
          break;
        }
        // have we got enough results?
        if (limit != 0 && limit <= (pagesize * (pagenum))) {
          break;
        }
      } else {
        resultsize = 0;
      }
    }
  } catch (ExistException e) {
    throw new JSONException("Exist exception");
  } catch (UnimplementedException e) {
    throw new JSONException("Unimplemented exception");
  } catch (UnderlyingStorageException e) {
    throw new JSONException("Underlying storage exception" + vocabname + e);
  }
  return displayNames;
}

/**
 * Get a list of tags for the specified photo.
 *
 * <p>This method does not require authentication.
 *
 * @param photoId The photo ID
 * @return The collection of Tag objects
 * @throws JSONException
 */
public Photo getListPhoto(String photoId) throws IOException, FlickrException, JSONException {
  List<Parameter> parameters = new ArrayList<Parameter>();
  parameters.add(new Parameter("method", METHOD_GET_LIST_PHOTO));
  parameters.add(new Parameter("api_key", apiKey));

  parameters.add(new Parameter("photo_id", photoId));

  Response response = transportAPI.get(transportAPI.getPath(), parameters);
  if (response.isError()) {
    throw new FlickrException(response.getErrorCode(), response.getErrorMessage());
  }

  JSONObject photoElement = response.getData().getJSONObject("photo");
  Photo photo = new Photo();
  photo.setId(photoElement.getString("id"));

  List<Tag> tags = new ArrayList<Tag>();
  JSONObject tagsElement = photoElement.getJSONObject("tags");
  JSONArray tagElements = tagsElement.optJSONArray("tag");
  for (int i = 0; tagElements != null && i < tagElements.length(); i++) {
    JSONObject tagElement = tagElements.getJSONObject(i);
    Tag tag = new Tag();
    tag.setId(tagElement.getString("id"));
    tag.setAuthor(tagElement.getString("author"));
    tag.setAuthorName(tagElement.getString("authorname"));
    tag.setRaw(tagElement.getString("raw"));
    tag.setValue(tagElement.getString("_content"));
    tags.add(tag);
  }
  photo.setTags(tags);
  return photo;
}

