private MediaConstraints constraintsFromJSON(String jsonString) {
  try {
    MediaConstraints constraints = new MediaConstraints();
    JSONObject json = new JSONObject(jsonString);
    if (json.has("mandatory")) {
      JSONObject mandatoryJSON = json.getJSONObject("mandatory");
      JSONArray mandatoryKeys = mandatoryJSON.names();
      for (int i = 0; i < mandatoryKeys.length(); ++i) {
        String key = (String) mandatoryKeys.getString(i);
        String value = mandatoryJSON.getString(key);
        constraints.mandatory.add(new MediaConstraints.KeyValuePair(key, value));
      }
    }
    if (json.has("optional")) {
      JSONArray optionalJSON = json.getJSONArray("optional");
      for (int i = 0; i < optionalJSON.length(); ++i) {
        JSONObject keyValueDict = optionalJSON.getJSONObject(i);
        String key = keyValueDict.names().getString(0);
        String value = keyValueDict.getString(key);
        constraints.optional.add(new MediaConstraints.KeyValuePair(key, value));
      }
    }
    return constraints;
  } catch (JSONException e) {
    throw new RuntimeException(e);
  }
}

/**
 * Parse a JSON expression and transform it to a WSRequest object
 *
 * @param jsonString
 * @return
 * @throws JSONException
 */
public static final WSRequest parseJSON(String jsonString) throws JSONException {
  JSONObject jsonParametersObject = new JSONObject(jsonString);
  JSONObject jsonRequest = jsonParametersObject.getJSONObject("wsRequest");
  WSRequest request = new WSRequest();
  request.service = jsonRequest.getString("service");
  request.binding = jsonRequest.getString("binding");
  request.operation = jsonRequest.getString("operation");
  request.wsdlUrl = jsonRequest.getString("wsdlUrl");
  JSONArray paramsArray = jsonParametersObject.getJSONArray("formParameters");
  for (int i = 0; i < paramsArray.length(); i++) {
    if (!request
        .getParamList()
        .containsKey(paramsArray.getJSONObject(i).getString("paramName"))) {
      List<String> valueList = new ArrayList<String>();
      valueList.add(paramsArray.getJSONObject(i).getString("paramValue"));
      request.getParamList().put(paramsArray.getJSONObject(i).getString("paramName"), valueList);
    } else {
      request
          .getParamList()
          .get(paramsArray.getJSONObject(i).getString("paramName"))
          .add(paramsArray.getJSONObject(i).getString("paramValue"));
    }
  }
  return request;
}

protected static Node reconstructNode(JSONObject o) throws JSONException {
  Node node = null;

  String nodeType = o.getString("nodeType");
  if (nodeType.startsWith("cell-as-")) {
    String columnName = o.getString("columnName");

    if ("cell-as-topic".equals(nodeType)) {
      if (o.has("type")) {
        node =
            new CellTopicNode(
                columnName,
                o.getBoolean("createForNoReconMatch"),
                reconstructType(o.getJSONObject("type")));
      }
    } else if ("cell-as-value".equals(nodeType)) {
      node = new CellValueNode(columnName, o.getString("valueType"), o.getString("lang"));
    } else if ("cell-as-key".equals(nodeType)) {
      node = new CellKeyNode(columnName, reconstructTopic(o.getJSONObject("namespace")));
    }
  } else if ("topic".equals(nodeType)) {
    node = new FreebaseTopicNode(reconstructTopic(o.getJSONObject("topic")));
  } else if ("value".equals(nodeType)) {
    node = new ValueNode(o.get("value"), o.getString("valueType"), o.getString("lang"));
  } else if ("anonymous".equals(nodeType)) {
    node = new AnonymousNode(reconstructType(o.getJSONObject("type")));
  }

  if (node != null && node instanceof NodeWithLinks && o.has("links")) {
    NodeWithLinks node2 = (NodeWithLinks) node;

    JSONArray links = o.getJSONArray("links");
    int linkCount = links.length();

    for (int j = 0; j < linkCount; j++) {
      JSONObject oLink = links.getJSONObject(j);

      node2.addLink(
          new Link(
              reconstructProperty(oLink.getJSONObject("property")),
              oLink.has("target") && !oLink.isNull("target")
                  ? reconstructNode(oLink.getJSONObject("target"))
                  : null));
    }
  }

  return node;
}

