 *
 * @throws IOException
 * @throws JSONException
 */
private void readDiseaseInfo() throws IOException, JSONException {
  String pathToOMIMJSON = rootDir.getAbsolutePath() + "/omim.json";
  File omimJSON = new File(pathToOMIMJSON);
  if (!omimJSON.exists()) {
    throw new IllegalArgumentException(
        "OMIM json file at path " + pathToOMIMJSON + " does not exist");
  }

  BufferedReader reader = new BufferedReader(new FileReader(omimJSON));
  JSONTokener jsonReader = new JSONTokener(reader);

  JSONObject omim = new JSONObject(jsonReader);

  Iterator it = omim.keys();
  while (it.hasNext()) {
    Object key = it.next();
    String id = key.toString();
    JSONObject jobj = omim.getJSONObject(id);
    DiseaseInfo disInfo = new DiseaseInfo(id, jobj);
    diseaseMap.put(id, disInfo);
  }

  System.out.println("Found " + diseaseMap.size() + " disease descriptions");
  reader.close();
}

@Test
public void testRebaseStopOnConflictAndContinue() throws Exception {
  URI workspaceLocation = createWorkspace(getMethodName());
  IPath[] clonePaths = createTestProjects(workspaceLocation);

  for (IPath clonePath : clonePaths) {
    // clone a repo
    JSONObject clone = clone(clonePath);

    String contentLocation = clone.getString(ProtocolConstants.KEY_CONTENT_LOCATION);
    String cloneLocation = clone.getString(ProtocolConstants.KEY_LOCATION);
    String branchesLocation = clone.getString(GitConstants.KEY_BRANCH);

    // get project metadata
    WebRequest request = getGetRequest(contentLocation);
    WebResponse response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());
    JSONObject project = new JSONObject(response.getText());

    JSONObject gitSection = project.getJSONObject(GitConstants.KEY_GIT);

    String gitHeadUri = gitSection.getString(GitConstants.KEY_HEAD);
    String gitIndexUri = gitSection.getString(GitConstants.KEY_INDEX);
    String gitStatusUri = gitSection.getString(GitConstants.KEY_STATUS);

    // modify file while on 'master'
    JSONObject testTxt = getChild(project, "test.txt");
    modifyFile(testTxt, "1\n2\n3");

    // "git add ."
    request = GitAddTest.getPutGitIndexRequest(gitIndexUri);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // commit all
    request = GitCommitTest.getPostGitCommitRequest(gitHeadUri, "first commit on master", false);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // create branch 'a'
    branch(branchesLocation, "a");

    // modify file while on 'master'
    modifyFile(testTxt, "1master\n2\n3");

    // "git add ."
    request = GitAddTest.getPutGitIndexRequest(gitIndexUri);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // commit all
    request = GitCommitTest.getPostGitCommitRequest(gitHeadUri, "second commit on master", false);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // checkout 'a'
    Repository db1 = getRepositoryForContentLocation(contentLocation);
    Git git = new Git(db1);
    assertBranchExist(git, "a");
    checkoutBranch(cloneLocation, "a");

    // modify while on 'a' - conflicting change (first line) and non-conflicting (last line)
    modifyFile(testTxt, "1a\n2\n3\n4a");

    // "git add ."
    request = GitAddTest.getPutGitIndexRequest(gitIndexUri);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // commit all
    request = GitCommitTest.getPostGitCommitRequest(gitHeadUri, "first commit on a", false);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // assert clean
    assertStatus(StatusResult.CLEAN, gitStatusUri);

    // rebase: "git rebase master"
    JSONObject rebase = rebase(gitHeadUri, "master");
    RebaseResult.Status rebaseResult =
        RebaseResult.Status.valueOf(rebase.getString(GitConstants.KEY_RESULT));
    assertEquals(RebaseResult.Status.STOPPED, rebaseResult);

    // check conflicting file
    request = getGetRequest(testTxt.getString(ProtocolConstants.KEY_LOCATION));
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());
    assertTrue(
        response.getText(),
        Pattern.matches(
            "<<<<<<< Upstream, based on .*\n1master\n=======\n1a\n>>>>>>> .* first commit on a\n2\n3\n4a\n",
            response.getText()));

    // continue rebase without conflict resolving
    rebase = rebase(gitHeadUri, Operation.CONTINUE);
    AdditionalRebaseStatus errRebaseResult =
        AdditionalRebaseStatus.valueOf(rebase.getString(GitConstants.KEY_RESULT));
    assertEquals(AdditionalRebaseStatus.FAILED_UNMERGED_PATHS, errRebaseResult);

    // resolve conflict
    modifyFile(testTxt, "1amaster\n2\n3\n4a");

    // and add
    request = GitAddTest.getPutGitIndexRequest(gitIndexUri);
    response = webConversation.getResponse(request);
    assertEquals(HttpURLConnection.HTTP_OK, response.getResponseCode());

    // continue rebase
    rebase = rebase(gitHeadUri, Operation.CONTINUE);
    rebaseResult = RebaseResult.Status.valueOf(rebase.getString(GitConstants.KEY_RESULT));
    assertEquals(RebaseResult.Status.OK, rebaseResult);

    // assert clean
    assertStatus(StatusResult.CLEAN, gitStatusUri);
  }
}

private void verifySubQueue(
    JSONObject info, String q, float parentAbsCapacity, float parentAbsMaxCapacity)
    throws JSONException, Exception {
  int numExpectedElements = 11;
  boolean isParentQueue = true;
  if (!info.has("queues")) {
    numExpectedElements = 20;
    isParentQueue = false;
  }
  assertEquals("incorrect number of elements", numExpectedElements, info.length());

  QueueInfo qi = isParentQueue ? new QueueInfo() : new LeafQueueInfo();
  qi.capacity = (float) info.getDouble("capacity");
  qi.usedCapacity = (float) info.getDouble("usedCapacity");
  qi.maxCapacity = (float) info.getDouble("maxCapacity");
  qi.absoluteCapacity = (float) info.getDouble("absoluteCapacity");
  qi.absoluteMaxCapacity = (float) info.getDouble("absoluteMaxCapacity");
  qi.absoluteUsedCapacity = (float) info.getDouble("absoluteUsedCapacity");
  qi.numApplications = info.getInt("numApplications");
  qi.usedResources = info.getString("usedResources");
  qi.queueName = info.getString("queueName");
  qi.state = info.getString("state");

  verifySubQueueGeneric(q, qi, parentAbsCapacity, parentAbsMaxCapacity);

  if (isParentQueue) {
    JSONArray arr = info.getJSONObject("queues").getJSONArray("queue");
    // test subqueues
    for (int i = 0; i < arr.length(); i++) {
      JSONObject obj = arr.getJSONObject(i);
      String q2 = q + "." + obj.getString("queueName");
      verifySubQueue(obj, q2, qi.absoluteCapacity, qi.absoluteMaxCapacity);
    }
  } else {
    LeafQueueInfo lqi = (LeafQueueInfo) qi;
    lqi.numActiveApplications = info.getInt("numActiveApplications");
    lqi.numPendingApplications = info.getInt("numPendingApplications");
    lqi.numContainers = info.getInt("numContainers");
    lqi.maxApplications = info.getInt("maxApplications");
    lqi.maxApplicationsPerUser = info.getInt("maxApplicationsPerUser");
    lqi.maxActiveApplications = info.getInt("maxActiveApplications");
    lqi.maxActiveApplicationsPerUser = info.getInt("maxActiveApplicationsPerUser");
    lqi.userLimit = info.getInt("userLimit");
    lqi.userLimitFactor = (float) info.getDouble("userLimitFactor");
    verifyLeafQueueGeneric(q, lqi);
  }
}

