private static List<Annotation> getAnnotationsList(
    Context context, String annotationRequestUrl, Location location, boolean retrieveAll)
    throws EnvSocialComException, EnvSocialContentException {

  // get data of the user executing this action
  String userUri = Preferences.getUserUri(context);
  AppClient client = new AppClient(context);

  // append virtual access flag to the request url
  // if location is null, the flag will have been set earlier in the url
  if (location != null) {
    boolean virtualAccess = location.hasVirtualAccess();
    annotationRequestUrl =
        Url.appendOrReplaceParameter(
            annotationRequestUrl, "virtual", Boolean.toString(virtualAccess));
  }

  HttpResponse response;
  String responseData;

  try {
    response = client.makeGetRequest(annotationRequestUrl);
    responseData = EntityUtils.toString(response.getEntity());
  } catch (Exception e) {
    throw new EnvSocialComException(userUri, HttpMethod.GET, EnvSocialResource.ANNOTATION, e);
  }

  // Check the status code
  if (response.getStatusLine().getStatusCode() != HttpStatus.SC_OK) {
    // Log.d(TAG, "[DEBUG]>> Error response on annotations list: " + responseData);
    throw EnvSocialComException.newInstanceFrom(
        response.getStatusLine().getStatusCode(),
        userUri,
        HttpMethod.GET,
        EnvSocialResource.ANNOTATION,
        null);
  }

  // If SC_OK, parse response
  try {
    List<Annotation> annotations = parse(context, responseData, location);

    // if we want to consume the entire annotations list
    if (retrieveAll) {
      JSONObject meta = new JSONObject(responseData).getJSONObject("meta");
      String next = meta.getString("next");

      if (next != null && !next.equalsIgnoreCase("null")) {
        next = Url.getFullPath(next);
        annotations.addAll(getAnnotationsList(context, next, location, true));
      }
    }

    return annotations;

  } catch (JSONException e) {
    throw new EnvSocialContentException(responseData, EnvSocialResource.ANNOTATION, e);
  } catch (ParseException e) {
    throw new EnvSocialContentException(responseData, EnvSocialResource.ANNOTATION, e);
  }
}

@Override
public void run() {
  try {
    socket = new ServerSocket(portNum);
    Log.v(TAG, "Server set up at port: " + portNum);
  } catch (IOException e) {
    Log.e(TAG, "Failure to create ServerSocket");
    return;
  }
  // attempt to set the timeout between successive checks of _timeToClose flag
  try {
    socket.setSoTimeout(_timeOut);
  } catch (SocketException e) {
    e.printStackTrace();
    return;
  }
  Log.v("RPCThread", "Server ready to accept clients");
  // loop until time to close
  boolean error = false;
  boolean timeout = false;
  Socket s = null;
  int id = 1;
  while (true) {
    // set up socket to accept. Code hangs on .accept() until a connection is established or
    // TIMEOUT ms have passed.
    TCPMessageHandler handler = null;
    try {
      s = socket.accept();
      s.setSoTimeout(_timeOut);
      handler = new TCPMessageHandler(s);
      handler.setMaxReadLength(Integer.MAX_VALUE);
      Log.v(TAG, "run: TCP connection established.");
    } catch (SocketTimeoutException e) {
      timeout = true;
    } catch (IOException e) {
      Log.e(TAG, "run: IOException on accept.");
      error = true;
    }
    if (!error && !timeout) {
      String host = s.getInetAddress().getHostAddress();
      try {
        Log.v(TAG, "reading from client");
        JSONObject handshake = handler.readMessageAsJSONObject();
        if (handshake.has("type")) {
          if (handshake.getString("type").equals("control")) {
            JSONObject successMsg = new JSONObject();
            successMsg.put("id", id);
            id++;
            successMsg.put("host", host);
            successMsg.put("callid", handshake.getInt("id"));
            successMsg.put("type", "OK");
            handler.sendMessage(successMsg);
            Log.v(TAG, "received handshake");
          } else {
            JSONObject errorMsg = new JSONObject();
            errorMsg.put("id", id);
            id++;
            errorMsg.put("host", host);
            errorMsg.put("callid", -1);
            errorMsg.put("type", "ERROR");
            errorMsg.put("msg", "Error establishing connection");
            handler.sendMessage(errorMsg);
            Log.w(TAG, "received improper handshake");
            s.close();
            handler.discard();
            break;
          }
        } else {
          JSONObject errorMsg = new JSONObject();
          errorMsg.put("id", id);
          id++;
          errorMsg.put("host", host);
          errorMsg.put("callid", -1);
          errorMsg.put("type", "ERROR");
          errorMsg.put("msg", "Error establishing connection");
          handler.sendMessage(errorMsg);
          Log.w(TAG, "received potential handshake that was not formulated correctly");
          s.close();
          handler.discard();
          break;
        }
        Log.v(TAG, "reading request from client");
        JSONObject request = handler.readMessageAsJSONObject();
        if (request.has("type")) {
          if (request.getString("type").equals("invoke")) {
            String app = request.getString("app");
            String method = request.getString("method");
            JSONObject args = request.getJSONObject("args");
            JSONObject response = new JSONObject();
            response.put("id", id);
            id++;
            response.put("host", host);
            response.put("callid", request.getInt("id"));
            try {
              Log.v(TAG, "Evaluating request");
              JSONObject result = parent.accessMethod(app, method, args);
              if (result == null) {
                response.put("type", "ERROR");
                response.put("message", "That method/app does not exist");
                response.put("callargs", request);
              } else {
                response.put("type", "OK");
                response.put("value", result);
              }
            } catch (Exception e) {
              response.put("type", "ERROR");
              response.put("message", "The method called caused an exception");
              Log.w(TAG, e.getMessage());
              response.put("callargs", request);
            }
            handler.sendMessage(response);
          } else {
            JSONObject errorMsg = new JSONObject();
            errorMsg.put("id", id);
            id++;
            errorMsg.put("host", host);
            errorMsg.put("callid", -1);
            errorMsg.put("type", "ERROR");
            errorMsg.put("message", "Error receiving request");
            errorMsg.put("callargs", request);
            handler.sendMessage(errorMsg);
            Log.w(TAG, "received potential request that was not formulated correctly");
          }
        } else {
          JSONObject errorMsg = new JSONObject();
          errorMsg.put("id", id);
          id++;
          errorMsg.put("host", host);
          errorMsg.put("callid", -1);
          errorMsg.put("type", "ERROR");
          errorMsg.put("message", "Error receiving request");
          errorMsg.put("callargs", request);
          handler.sendMessage(errorMsg);
          Log.w(TAG, "received potential request that was not formulated correctly");
        }

      } catch (NullPointerException e) {
        Log.e(TAG, "run: socket connection closed unexpectedly");
      } catch (SocketTimeoutException e) {
        Log.e(TAG, "run: socket timeout while waiting for request");
      } catch (IOException e) {
        Log.e(TAG, "run: IOException when reading from socket");
      } catch (JSONException e) {
        Log.e(TAG, "run: JSONException when reading from socket");
      }
    }
    if (!timeout) {
      try {
        Log.v(TAG, "run: Attempting to close connection");
        s.close();
        handler.discard();
        handler = null;
        s = null;
      } catch (IOException e) {
        Log.e(TAG, "failed to close socket to client");
      }
    }

    // check if time to close; close if it is
    if (_timeToClose) {
      try {
        socket.close();
        Log.v(TAG, "closed server socket");
      } catch (IOException e) {
        e.printStackTrace();
      }
      return;
    }
    error = false;
    timeout = false;
  }
}

