@Override
public InputStream doAction(HttpServletRequest request) throws InvalidParameterException {
  String jsStr = HttpUtils.getParam("param", request);
  try {
    // Extract data to sign
    JSONObject params = new JSONObject(jsStr);
    SecurityToken token = new AuthInfo(request).getSecurityToken();
    UserId userId = new UserId(UserId.Type.me, null);
    HashMap<String, JSONObject> uriStat = new HashMap<String, JSONObject>();

    if (JSONObject.getNames(params) == null) throw new InvalidParameterException("No parameters");

    for (String i : JSONObject.getNames(params)) {
      JSONObject jo = new JSONObject();
      SigningState stat = SigningState.FINISHED;
      SigningResult res = SigningResult.ERR_FAIL;
      SigningRequestDb signReq = null;
      JSONObject data = params.getJSONObject(i);
      try {
        signReq =
            (SigningRequestDb)
                cryptoService.addSigningRequest(userId, i, data.getString("title"), token).get();
        stat = signReq.getState();
        res = signReq.getResult();
      } catch (CryptoServiceException e) {
        LOG.fine(LogUtils.getTrace(e));
        res = e.getResult();
      } catch (JSONException e) {
        LOG.severe(LogUtils.getTrace(e));
        throw new InvalidParameterException(e.getMessage());
      } catch (Exception e) {
        LOG.severe(LogUtils.getTrace(e));
      }

      if (signReq != null) {
        jo.put("transaction_id", signReq.getObjectId());
        String title = "   .";
        activGen.generateActivity(request, title, title);
      }
      jo.put("status", stat.ordinal());
      jo.put("result", res.ordinal());
      uriStat.put(i, jo);
    }

    JSONObject jsRes = new JSONObject(uriStat);
    // Writing response
    return new ByteArrayInputStream(jsRes.toString().getBytes());
  } catch (Exception e) {
    LOG.severe(LogUtils.getTrace(e));
    throw new InvalidParameterException(e.getMessage());
  }
}

