public static String navagation(String origin, String destination, String city)
    throws IOException {

  if (origin == null || destination == null || origin.equals("") || destination.equals(""))
    return "";

  URL url =
      new URL(
          "http://api.map.baidu.com/direction/v1?mode=driving&origin="
              + java.net.URLEncoder.encode(origin, "utf-8")
              + "&destination="
              + java.net.URLEncoder.encode(destination, "utf-8")
              + "&origin_region="
              + city
              + "&destination_region="
              + java.net.URLEncoder.encode(city, "utf-8")
              + "&output=json&ak="
              + ak);
  URLConnection connection = url.openConnection();
  connection.setDoOutput(true);
  OutputStreamWriter out = new OutputStreamWriter(connection.getOutputStream(), "utf-8");
  // remember to clean up
  out.flush();
  out.close();
  String res;
  InputStream l_urlStream;
  l_urlStream = connection.getInputStream();
  BufferedReader in = new BufferedReader(new InputStreamReader(l_urlStream, "UTF-8"));
  StringBuilder sb = new StringBuilder("");
  while ((res = in.readLine()) != null) {
    sb.append(res.trim());
  }
  String str = sb.toString();
  StringBuilder st = new StringBuilder();
  try {
    JSONObject jsonObject = JSONObject.fromObject(str);
    JSONObject ob = jsonObject.getJSONObject("result").getJSONArray("routes").getJSONObject(0);
    JSONArray steps = ob.getJSONArray("steps");
    for (int i = 0; i < steps.size(); i++) {
      String instruction = (String) steps.getJSONObject(i).get("instructions");
      instruction =
          StringUtils.replaceEach(
              instruction,
              new String[] {"<b>", "</b>", "<font color=\"0x000000\"", "</font>", ">", ""},
              new String[] {"", "", "", "", "", ""});
      st.append(instruction + "\n");
    }
  } catch (Exception e) {
    st.append("");
  }
  return st.toString();
}

