private void parseReceivedData(JSONObject jsonObject) {
  try {
    String dataTypeString = jsonObject.getString("type");

    debug("dataTypeString : " + dataTypeString);
    debug("jsonObject : " + jsonObject.toString());

    if (dataTypeString != null) {
      if (dataTypeString.equalsIgnoreCase(TYPE_GET_DAMAGED)) {
        String skillTypeString = jsonObject.getString("skill_type");
        int skillType = Integer.parseInt(skillTypeString);

        if (this.getDamagedCallback != null) {
          this.getDamagedCallback.didGetDamaged(SkillType.parseInt(skillType));
        }
      } else if (dataTypeString.equalsIgnoreCase(TYPE_LOGIN)) {
        if (this.loginCallback != null) {
          if (jsonObject.getString("status").equalsIgnoreCase("success")) {
            String userString = jsonObject.getString("user");
            JSONObject userJsonObject = new JSONObject(userString);
            String id = userJsonObject.getString("login_id");
            int character = Integer.parseInt(userJsonObject.getString("character"));
            int number_of_wins = userJsonObject.getInt("number_of_wins");
            int total_wins = userJsonObject.getInt("total_wins");
            int total_loses = userJsonObject.getInt("total_loses");
            boolean is_logon = true;

            this.loginCallback.didSuccessLogin(
                new User(id, character, number_of_wins, is_logon, total_wins, total_loses));
          } else {
            this.loginCallback.didFailedLogin(jsonObject.getString("message"));
          }
          this.loginCallback = null;
        }
      } else if (dataTypeString.equalsIgnoreCase(TYPE_JOIN)) {
        if (this.joinCallback != null) {
          if (jsonObject.getString("status").equalsIgnoreCase("success")) {
            String userString = jsonObject.getString("user");
            JSONObject userJsonObject = new JSONObject(userString);
            String id = userJsonObject.getString("login_id");
            int character = Integer.parseInt(userJsonObject.getString("character"));
            int number_of_wins = userJsonObject.getInt("number_of_wins");
            boolean is_logon = true;
            int total_wins = userJsonObject.getInt("total_wins");
            int total_loses = userJsonObject.getInt("total_loses");

            this.joinCallback.didSuccessJoin(
                new User(id, character, number_of_wins, is_logon, total_wins, total_loses));
          } else {
            this.joinCallback.didFailedJoin(jsonObject.getString("message"));
          }
          this.joinCallback = null;
        }
      } else if (dataTypeString.equalsIgnoreCase(TYPE_REQUEST_FRIENDS)) {
        if (this.requestFriendsCallback != null) {
          JSONArray jsonFriends = jsonObject.getJSONArray("friends");

          ArrayList<User> friends = new ArrayList<User>();
          for (int i = 0; i < jsonFriends.length(); i++) {
            JSONObject friend = jsonFriends.getJSONObject(i);
            friends.add(User.parseJson(friend));
          }

          this.requestFriendsCallback.didGetFriends(friends);

          this.requestFriendsCallback = null;
        }
      } else if (dataTypeString.equalsIgnoreCase(TYPE_REQUEST_MATCHING)) {
        if (this.onMatchedCallback != null) {
          JSONObject enemy = jsonObject.getJSONObject("user_information");
          this.onMatchedCallback.onMatched(User.parseJson(enemy));
          this.onMatchedCallback = null;
        }
      } else if (dataTypeString.equalsIgnoreCase(TYPE_GAME_END_CHECK)) {
        gameEndRequest();
      } else if (dataTypeString.equalsIgnoreCase(TYPE_GAME_END)) {
        if (this.onGameEndedCallback != null) {
          boolean isWin = jsonObject.getString("status").equalsIgnoreCase("win");
          this.onGameEndedCallback.onGameEnded(
              isWin, User.parseJson(jsonObject.getJSONObject("user_information")));
          this.onGameEndedCallback = null;
        }
      } else if (dataTypeString.equalsIgnoreCase(TYPE_LOGOUT)) {
        if (this.onLogout != null) {
          if (jsonObject.getString("status").equalsIgnoreCase("success")) {
            this.onLogout.onLogoutSuccess();
            closeSocketConnection();
          } else {
            this.onLogout.onLogoutFailed();
          }
          this.onLogout = null;
        }
      }
    }

  } catch (JSONException e) {
    e.printStackTrace();
  }
}

/**
 * Run relevance searches for the first n cells in the given column and count the types of the
 * results. Return a sorted list of types, from most frequent to least.
 *
 * @param project
 * @param column
 * @return
 */
protected List<TypeGroup> guessTypes(Project project, Column column) {
  Map<String, TypeGroup> map = new HashMap<String, TypeGroup>();

  int cellIndex = column.getCellIndex();

  List<String> samples = new ArrayList<String>(s_sampleSize);
  Set<String> sampleSet = new HashSet<String>();

  for (Row row : project.rows) {
    Object value = row.getCellValue(cellIndex);
    if (ExpressionUtils.isNonBlankData(value)) {
      String s = value.toString().trim();
      if (!sampleSet.contains(s)) {
        samples.add(s);
        sampleSet.add(s);
        if (samples.size() >= s_sampleSize) {
          break;
        }
      }
    }
  }

  try {
    StringWriter stringWriter = new StringWriter();
    JSONWriter jsonWriter = new JSONWriter(stringWriter);

    jsonWriter.object();
    for (int i = 0; i < samples.size(); i++) {
      jsonWriter.key("q" + i + ":search");
      jsonWriter.object();

      jsonWriter.key("query");
      jsonWriter.value(samples.get(i));
      jsonWriter.key("limit");
      jsonWriter.value(3);

      jsonWriter.endObject();
    }
    jsonWriter.endObject();

    StringBuffer sb = new StringBuffer(1024);
    sb.append("http://api.freebase.com/api/service/search?queries=");
    sb.append(ParsingUtilities.encode(stringWriter.toString()));

    URL url = new URL(sb.toString());
    URLConnection connection = url.openConnection();
    connection.setConnectTimeout(5000);
    connection.connect();

    InputStream is = connection.getInputStream();
    try {
      String s = ParsingUtilities.inputStreamToString(is);
      JSONObject o = ParsingUtilities.evaluateJsonStringToObject(s);

      for (int i = 0; i < samples.size(); i++) {
        String key = "q" + i + ":search";
        if (!o.has(key)) {
          continue;
        }

        JSONObject o2 = o.getJSONObject(key);
        if (!(o2.has("result"))) {
          continue;
        }

        JSONArray results = o2.getJSONArray("result");
        int count = results.length();

        for (int j = 0; j < count; j++) {
          JSONObject result = results.getJSONObject(j);
          double score = 1.0 / (1 + j); // score by each result's rank

          JSONArray types = result.getJSONArray("type");
          int typeCount = types.length();

          for (int t = 0; t < typeCount; t++) {
            JSONObject type = types.getJSONObject(t);
            String id = type.getString("id");
            if (id.equals("/common/topic")
                || id.equals("/base/ontologies/ontology_instance")
                || (id.startsWith("/base/") && id.endsWith("/topic"))
                || id.startsWith("/user/")
                || id.startsWith("/freebase/")) {
              continue;
            }

            if (map.containsKey(id)) {
              TypeGroup tg = map.get(id);
              tg.score += score;
              tg.count++;
            } else {
              map.put(id, new TypeGroup(id, type.getString("name"), score));
            }
          }
        }
      }
    } finally {
      is.close();
    }
  } catch (Exception e) {
    e.printStackTrace();
  }

  List<TypeGroup> types = new ArrayList<TypeGroup>(map.values());
  Collections.sort(
      types,
      new Comparator<TypeGroup>() {
        public int compare(TypeGroup o1, TypeGroup o2) {
          int c = Math.min(s_sampleSize, o2.count) - Math.min(s_sampleSize, o1.count);
          if (c != 0) {
            return c;
          }
          return (int) Math.signum(o2.score / o2.count - o1.score / o1.count);
        }
      });

  return types;
}

@Test
public void testTasksSlash() throws JSONException, Exception {
  WebResource r = resource();
  Map<JobId, Job> jobsMap = appContext.getAllJobs();
  for (JobId id : jobsMap.keySet()) {
    String jobId = MRApps.toString(id);
    ClientResponse response =
        r.path("ws")
            .path("v1")
            .path("mapreduce")
            .path("jobs")
            .path(jobId)
            .path("tasks/")
            .accept(MediaType.APPLICATION_JSON)
            .get(ClientResponse.class);
    assertEquals(MediaType.APPLICATION_JSON_TYPE, response.getType());
    JSONObject json = response.getEntity(JSONObject.class);
    assertEquals("incorrect number of elements", 1, json.length());
    JSONObject tasks = json.getJSONObject("tasks");
    JSONArray arr = tasks.getJSONArray("task");
    assertEquals("incorrect number of elements", 2, arr.length());

    verifyAMTask(arr, jobsMap.get(id), null);
  }
}

public void upload(Uri uriP) throws Exception {
  // If we are logged on
  if (server.isConnected()) {
    if (uriP.getPath() != null) {
      // Create the multipart
      MultipartBuilder builder = new MultipartBuilder(BOUNDARY, DEBUG);

      // The upload_type's part
      builder.addPart(new Part("upload_type").setContent("torrent".getBytes()));
      // The upload_type's part
      builder.addPart(new Part("desttext").setContent(getSharedDirectory(false).getBytes()));
      // The direction's part
      builder.addPart(new Part("direction").setContent("ASC".getBytes()));
      // The field's part
      builder.addPart(new Part("field").setContent("task_id".getBytes()));

      // The torrent's part
      Part filePart = new Part("torrent");
      filePart.addExtra("filename", uriP.getLastPathSegment());
      if (uriP.getPath().toLowerCase().endsWith("nzb")) {
        filePart.setContentType("application/octet-stream");
      } else {
        filePart.setContentType("application/x-bittorrent");
      }

      // Get the stream according to the Uri
      byte[] buffer = StreamFactory.getStream(uriP);

      // Set the content
      filePart.setContent(buffer);
      builder.addPart(filePart);
      // Execute
      JSONObject json;
      synchronized (server) {
        json = server.sendMultiPart(DM_URI_NEW, builder);
      }
      if (json != null) {
        boolean success = json.getBoolean("success");
        // If successful then build details list
        if (!success) {
          String reason = "";
          if (json.has("reason")) {
            reason = json.getString("reason");
          } else if (json.has("errno")) {
            JSONObject err = json.getJSONObject("errno");
            reason = err.getString("key");
          }
          throw new DSMException(reason);
        }
      }
    }
  }
}

/**
 * Parse server (JSON) response and returns InformationSharingPreferences object.
 *
 * @param response would be String converted from server response (JSON file)
 * @return InformationSharingPreferences object
 * @see com.socmaps.entity.InformationSharingPreferences
 */
public static InformationSharingPreferences parseInformationSettings(String response) {
  InformationSharingPreferences informationSharingPreferences =
      new InformationSharingPreferences();
  try {
    JSONObject jo = new JSONObject(response);
    JSONObject result = jo.getJSONObject("result");

    informationSharingPreferences.setNewsFeed(result.getString("newsfeed"));
    informationSharingPreferences.setProfilePicture(result.getString("avatar"));

    informationSharingPreferences.setEmail(result.getString("email"));
    informationSharingPreferences.setName(result.getString("firstName"));

    informationSharingPreferences.setUserName(result.getString("username"));
    informationSharingPreferences.setGender(result.getString("gender"));

    informationSharingPreferences.setDateOfBirth(result.getString("dateOfBirth"));
    informationSharingPreferences.setBiography(result.getString("bio"));

    informationSharingPreferences.setInterests(result.getString("interests"));
    informationSharingPreferences.setAddress(result.getString("address"));

    informationSharingPreferences.setService(result.getString("workStatus"));
    informationSharingPreferences.setRelationshipStatus(result.getString("relationshipStatus"));

    return informationSharingPreferences;
  } catch (JSONException e) {
    e.printStackTrace();
  }

  return null;
}

public static Post parseJSONObjectToPost(Host host, JSONObject json)
    throws JSONException, ParseException {
  if (json == null) return null;

  String file_url = json.getString(DanbooruLegacyPost.KEY_POST_FILE_URL);
  String file_url_large = json.getString(DanbooruLegacyPost.KEY_POST_LARGE_FILE_URL);
  String file_url_preview = json.getString(DanbooruLegacyPost.KEY_POST_PREVIEW_FILE_URL);
  if (!file_url.startsWith("http")) file_url = host.url + file_url;
  if (!file_url_large.startsWith("http")) file_url_large = host.url + file_url_large;
  if (!file_url_preview.startsWith("http")) file_url_preview = host.url + file_url_preview;

  JSONObject json_date = json.getJSONObject(DanbooruLegacyPost.KEY_POST_CREATED_AT);
  Date date = new Date(json_date.getLong("s") * 1000 + json_date.getLong("n") / 1000000);

  int uploader_id = -1;
  String uploader_name = "";
  try {
    uploader_id = json.getInt(DanbooruLegacyPost.KEY_POST_UPLOADER_ID);
  } catch (JSONException ignored) {
  }
  try {
    uploader_name = json.getString(DanbooruLegacyPost.KEY_POST_UPLOADER_NAME);
  } catch (JSONException ignored) {
  }

  return new DanbooruLegacyPost(
      host,
      json.getInt(DanbooruLegacyPost.KEY_POST_ID),
      json.getInt(DanbooruLegacyPost.KEY_POST_IMAGE_WIDTH),
      json.getInt(DanbooruLegacyPost.KEY_POST_IMAGE_HEIGHT),
      date,
      date,
      json.getInt(DanbooruLegacyPost.KEY_POST_FILE_SIZE),
      file_url,
      file_url_large,
      file_url_preview,
      TextUtils.split(json.getString(DanbooruLegacyPost.KEY_POST_TAG_STRING), " "),
      json.getString(DanbooruLegacyPost.KEY_POST_RATING),
      uploader_id,
      uploader_name,
      json.getString(DanbooruLegacyPost.KEY_POST_MD5),
      json.getInt(DanbooruLegacyPost.KEY_POST_SCORE));
}
